         REGULAR_EXPRESSION => q%^\s*\((?'group'[0-9a-fA-F]{4})\,(?'elem'[0-9a-fA-F]{4})\)\s*(?'vr'[a-zA-Z\?][a-zA-Z\?])\s*\[?\(?(?'value'.*)\)?\]?.*?$%,
